#include <stdio.h>

int main()
{
    double a;
    double d;
    double n;
    double sum;
    
    printf("Enter the first value in the sequence:\n");
    scanf("%lf", &a);
    
    printf("Enter the difference between consecutive values:\n");
    scanf("%lf", &d);
    
    printf("Enter the number of values in the sequence:\n");
    scanf("%lf", &n);
    
    sum = (n * a) + (n / 2) * (d * n - d);
    
    printf("Sum = %.0lf", sum);
    
    return 0;
}

