#include <stdio.h>

int main(void)
{
    char letter;
    int steps;
    char nextletter;
    int reps;
    int ogsteps;
    printf("Enter letter:\n");
    scanf("%c", &letter);
    
    printf("Enter steps:\n");
    scanf("%d", &ogsteps);
    
    steps = ogsteps;
    
    if (steps > 25)
    {
        reps = steps / 26;
        printf("reps %d\n", reps);
        
        steps = steps - (reps * 26);
    }
    
    
    
    if (letter + steps < 91)
    {
        nextletter = (char)(letter + steps);
    }
    else
    {
        nextletter = (char)((letter + steps) - 26);
    }
    
    printf("%c -- %d --> %c", letter, ogsteps ,nextletter);
    return 0;

}

