#include <stdio.h>
#include <math.h>
int main(void) {
	char letter;
	int step;
	char newloc;
	int temp;
	printf("Enter letter:");
	scanf("%c",&letter);
	printf("\nEnter steps:");
    scanf("%d", &step);
  	if (step > 25) {
	    temp = round(((step / 26.f) - (step / 26)) * 26.f);
    }
    else {
	    temp = step;
    }

    newloc = letter + temp;
    
    if (newloc > 90) {
    	newloc -= 26;
    }
    else if (newloc < 65) {
    	newloc += 26;
    }

	printf("\n%c -- %d --> %c", letter, step, newloc);

	return 0;
}

